INSERT INTO `bal_ezprint` VALUES (1,'list','列表示例','<p></p><p style=\"text-align: center; \">基本信息</p><table data-type=\"table\" class=\"table table-bordered\" style=\"text-align: center;\"><tbody><tr><td>姓名</td><td><p><a class=\"printVar\" data-field=\"nickname\" href=\"nickname\">{nickname}</a><br></p></td></tr><tr><td>邮箱</td><td><p><a class=\"printVar\" data-field=\"email\" href=\"email\">{email}</a><br></p></td></tr></tbody></table>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<table data-type=\"dataSource\" id=\"list\" class=\"table table-bordered\"><tbody><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr></tbody></table> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<p></p><p></p><table data-type=\"dataSource\" id=\"list\" class=\"table table-bordered\"><tbody><tr><td><p><a class=\"printTableVar\" data-field=\"name\" href=\"name\">[姓名]</a><br></p></td><td><p><a class=\"printTableVar\" data-field=\"email\" href=\"email\">[邮箱]</a><br></p></td><td><p><a class=\"printTableVar\" data-field=\"createtime\" href=\"createtime\">[创建时间]</a><br></p></td></tr></tbody></table><p style=\"text-align: center; \"><br></p><p></p>',1591189280,1607441561),(2,'hetong','合同','<p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\"><a class=\"printVar\" data-field=\"company1\" href=\"company1\"><u><b>{company1}</b></u></a>公司（以下简称甲方）为统一和提高<a class=\"printVar\" data-field=\"company2\" href=\"company2\"><font color=\"#000000\" style=\"background-color: rgb(255, 0, 0);\"><u><b>{company2}</b></u></font></a>(以下简称乙方)的店面和产品形象。为乙方营造更好的销售环境，经双方协商，本着自愿、平等、互惠、互利的原则，达成如下协议：</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">自协议签定之日，甲方负责为乙方提供店面整体设计及装修。装修内容包括：</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">门头广告牌的设计、制作、安装;<br>产品形象墙的设计、制作、安装;<br>产品展示架的设计、制作、安装;<br>店内主体色调的制定、粉刷;<br>店内棚顶吊旗的设计、制作、安装;<br>甲方免费为乙方提供样板一套、安装工作服四套及各种证书和产品说明。</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">自协议签订之日起，乙方需向甲方交纳装修保证金人民币<a class=\"printVar\" data-field=\"price\" href=\"price\">{price}</a>元整。</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">乙方在协议签订之日起一年内不得兼营其它品牌或与甲方有冲突的产品，否则将扣除乙方的装修保证金。</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">甲、乙双方合作满一年后，乙方能很好的维护甲方的产品形象，并无违约情况，甲方将如数返还乙方的装修保证金（返款方式以地板兑现）。</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">本协议一式3份，甲方2份，乙方1份。<br>本协议修改由双方协商解决。<br>本协议自双方盖章之日起生效至年月日终止。</p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px; text-indent: 2em;\"><br style=\"text-indent: 0px;\"></p><p style=\"margin-bottom: 0px; padding: 5px 0px; font-family: tahoma, 微软雅黑; font-size: 16px;\">甲&nbsp;&nbsp;方：&nbsp;&nbsp;&nbsp;<b><a class=\"printVar\" data-field=\"name1\" href=\"name1\">{name1}</a>&nbsp;</b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 乙&nbsp;&nbsp;方：<a class=\"printVar\" data-field=\"name2\" href=\"name2\">{name2}</a><br>办公地址：&nbsp;&nbsp;&nbsp;<b><a class=\"printVar\" data-field=\"addr1\" href=\"addr1\">{addr1}</a>&nbsp;</b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;办公地址：<a class=\"printVar\" data-field=\"addr2\" href=\"addr2\"><b>{addr2}</b></a><br>开户银行：&nbsp;&nbsp;&nbsp;<b>&nbsp;<a class=\"printVar\" data-field=\"bank1\" href=\"bank1\">{bank1}</a>&nbsp;&nbsp;&nbsp;</b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 开户银行：<a class=\"printVar\" data-field=\"bank2\" href=\"bank2\"><b>{bank2}</b></a><br>代表人（签字）：&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 代表人（签字）：<br><br></p>',1592621691,1592665065),(3,'test','测试','<h2 style=\"text-align: center; \"><font color=\"#000000\" style=\"\"><u><span style=\"font-family: Arial;\">淮安润淮农产品批发有限公司（出场结算单）</span></u></font></h2><table data-type=\"table\" class=\"table table-bordered\"><tbody><tr><td><h4 style=\"text-align: center; \">车牌号</h4></td><td><h4 style=\"text-align: center; \"><a class=\"printVar\" data-field=\"小王卖菜\" href=\"小王卖菜\">{custom}</a></h4></td><td><h4 style=\"text-align: center;\">车型&nbsp;</h4></td><td><h4 style=\"text-align: center;\"><br></h4></td><td><h4 style=\"text-align: center;\">品类</h4></td><td><h4 style=\"text-align: center;\"><br></h4></td></tr><tr><td><h4 style=\"text-align: center; \">客户</h4></td><td><h4 style=\"text-align: center;\"><br></h4></td><td><h4 style=\"text-align: center;\">电话号码</h4></td><td><h4 style=\"text-align: center;\"><br></h4></td><td><h4 style=\"text-align: center;\">业务区</h4></td><td><h4 style=\"text-align: center;\"><br></h4></td></tr><tr><td><h4 style=\"text-align: center;\">毛重</h4></td><td><h4 style=\"text-align: center;\"><br></h4></td><td><h4 style=\"text-align: center;\">去皮重</h4></td><td><h4 style=\"text-align: center;\"><br></h4></td><td><h4 style=\"text-align: center;\">净重</h4></td><td><h4 style=\"text-align: center;\"><br></h4></td></tr><tr><td><h4 style=\"text-align: center;\">入场时间</h4></td><td><h4 style=\"text-align: center;\"><br></h4></td><td><h4 style=\"text-align: center;\">出场时间</h4></td><td><h4 style=\"text-align: center;\"><br></h4></td><td><h4 style=\"text-align: center;\">备注</h4></td><td><h4 style=\"text-align: center;\"><br></h4></td></tr><tr><td><h4 style=\"text-align: center;\">实际费用</h4></td><td><h4 style=\"text-align: center;\"><br></h4></td><td><h4 style=\"text-align: center; \">日期</h4></td><td><h5><br></h5></td><td><h3><br></h3></td><td><br></td></tr></tbody></table><p></p><p>进场操作员           出场操作员         查验人员<br></p><p>1、采购车辆出场结算单当日有效，次日作废<br>2、品类栏登记车上装载的蔬菜品种，8种以上有补贴<br>3、如果采购车辆弄虚作假，到周边市场倒货骗取补贴，一经发现将以拿补贴数额进行双倍罚款。<br>4、此信息单涂改无效，加盖公司印章方可生效。最终解释权归淮安润淮农产品批发有限公司所有。</p><p></p>',1607357457,1607377584),(4,'rhnp','结算','<p><font size=\"5mm\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 淮安润淮农产品批发有限公司（出场结算单）</font></p><font size=\"3mm\"></font><table data-type=\"table\" class=\"table table-bordered\" style=\"text-align: center;\"><tbody><tr><td style=\"height:5mm\"><b>日期</b></td><td><p><b><a class=\"printVar\" data-field=\"statement_date\" href=\"statement_date\">{statement_date}</a><br></b></p></td><td><b>车牌号</b></td><td><p><b><a class=\"printVar\" data-field=\"statement_plate_number\" href=\"statement_plate_number\">{statement_plate_number}</a><br></b></p></td><td><b>单号&nbsp;</b></td><td><p><b><a class=\"printVar\" data-field=\"statement_code\" href=\"http://127.0.0.1:9002/PByGmRKgDe.php/ezprint/printing/edit/ids/statement_code\" style=\"background-color: rgb(255, 255, 255);\">{statement_code}</a><br></b></p></td></tr><tr><td><b>卡号</b></td><td><p><a class=\"printVar\" data-field=\"card_code\" href=\"card_code\"><b>{card_code}</b></a><b><br></b></p></td><td><b>客户</b></td><td><p><b><a class=\"printVar\" data-field=\"custom_name\" href=\"custom_name\">{custom_name}</a><br></b></p></td><td><b>客户类型</b></td><td><p><a class=\"printVar\" data-field=\"custom_customtype\" href=\"custom_customtype\"><b>{custom_customtype}</b></a><b><br></b></p></td></tr><tr><td><b>毛重/kg</b></td><td><p><b><a class=\"printVar\" data-field=\"statement_GW\" href=\"statement_GW\">{statement_GW}</a><br></b></p></td><td><b>去皮重/kg</b></td><td><p><b><a class=\"printVar\" data-field=\"statement_tare\" href=\"statement_tare\">{statement_tare}</a><br></b></p></td><td><b>净重/kg</b></td><td><p><b><a class=\"printVar\" data-field=\"statement_NW\" href=\"statement_NW\">{statement_NW}</a><br></b></p></td></tr><tr><td><b>品类</b><br></td><td><b><a class=\"printVar\" data-field=\"product_name\" href=\"http://127.0.0.1:9002/PByGmRKgDe.php/ezprint/printing/edit/ids/product_name\" style=\"color: rgb(114, 175, 210); outline: none;\">{product_name}</a></b><br></td><td><b>单价</b></td><td><p><a class=\"printVar\" data-field=\"statement_product_price\" href=\"statement_product_price\"><b>{statement_product_price}</b></a><br></p></td><td><b>实际费用/元</b><br></td><td><a class=\"printVar\" data-field=\"statement_cost\" href=\"http://127.0.0.1:9002/PByGmRKgDe.php/ezprint/printing/edit/ids/statement_cost\" style=\"background-color: rgb(255, 255, 255);\"><b>{statement_cost}</b></a><br></td></tr><tr><td><b>入场时间</b></td><td><p><a class=\"printVar\" data-field=\"intime\" href=\"intime\"><b>{intime}</b></a><b><br></b></p></td><td><b>出场时间</b></td><td><p><a class=\"printVar\" data-field=\"outtime\" href=\"outtime\"><b>{outtime}</b></a><b><br></b></p></td><td><b>业务区</b></td><td><p><b><a class=\"printVar\" data-field=\"custom_businessarea\" href=\"custom_businessarea\">{custom_businessarea}</a><br></b></p></td></tr><tr><td><b>备注</b></td><td><p><b><a class=\"printVar\" data-field=\"statement_remark\" href=\"statement_remark\">{statement_remark}</a><br></b></p></td><td><b>车型</b></td><td><b><a class=\"printVar\" data-field=\"statement_mototype\" href=\"http://127.0.0.1:9002/PByGmRKgDe.php/ezprint/printing/edit/ids/statement_mototype\" style=\"background-color: rgb(255, 255, 255);\">{statement_mototype}</a><br></b></td><td><b>电话</b></td><td><p><b><a class=\"printVar\" data-field=\"custom_tel\" href=\"http://127.0.0.1:9002/PByGmRKgDe.php/ezprint/printing/edit/ids/custom_tel\" style=\"color: rgb(114, 175, 210); outline: none;\">{custom_tel}</a></b><br></p></td></tr></tbody></table><p>进场操作员:&nbsp; &nbsp; <a class=\"printVar\" data-field=\"statement_inoperator\" href=\"statement_inoperator\">{statement_inoperator}</a>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 出场操作员:<a class=\"printVar\" data-field=\"statement_outo